import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Set mobile viewport
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open mobile menu using the nav-menu button
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');

    // Wait for mobile menu to be visible and take screenshot
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // Extract menu items text for verification
    const menuItems = await page.$$eval('#mobileMenuOverlay a', 
      elements => elements.map(el => el.textContent.trim()));

    // Click on a menu item (Electronics)
    await page.waitForSelector('#mobileMenuOverlay.show a', { timeout: 5000 });
    await page.click('#mobileMenuOverlay.show a:nth-child(1)');

    // Wait for navigation to complete and take screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_navigation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_navigation.png'));

    // Close mobile menu using close button
    await page.waitForSelector('.close-mobile-menu', { timeout: 5000 });
    await page.click('.close-mobile-menu');

    // Wait for menu to close and take final screenshot
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'hidden', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    return {
      success: true,
      action: "Successfully tested mobile menu navigation - opened menu, selected Electronics category, and closed menu",
      extractedData: {
        menuItems: menuItems,
        firstMenuItem: menuItems[0] || 'No items found'
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete mobile menu navigation test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
